import PartList from '../components/UI/PartList/PartList';
import { observer } from 'mobx-react-lite';
import { Context } from '../../src/index';
import { fetchCategories } from '../http/partAPI';

const Shop = observer (() => {
    
    
    
    // useEffect(() => {
