    return (
        <main className={styles.shop__main_container}>
            <div className={styles.shop__div_container_category}>
            <CategoryBar/>
            
            </div>
            <div className={styles.shop__div_container_brand_part}>
            <BrandBar/>
            <PartList/>
            </div>
        </main>
    );
});

export default Shop;
